CREATE DATABASE library;
USE library;

SET NAMES utf8;
START TRANSACTION;
CREATE TABLE `admin` (
	`admin_id` BIGINT NOT NULL PRIMARY KEY COMMENT '账号',
	`password` VARCHAR ( 20 ) NOT NULL COMMENT '密码',
	`username` VARCHAR ( 20 ) DEFAULT NULL COMMENT '用户名' 
) ENGINE = INNODB DEFAULT CHARSET = utf8;
CREATE TABLE `book_info` (
	`book_id` BIGINT NOT NULL PRIMARY KEY COMMENT '图书编号',
	`name` VARCHAR ( 50 ) NOT NULL COMMENT '书名',
	`author` VARCHAR ( 20 ) NOT NULL COMMENT '作者',
	`publish` VARCHAR ( 20 ) NOT NULL COMMENT '出版社',
	`cover` BLOB COMMENT'书本封面',
	`ISBN` VARCHAR ( 20 ) NOT NULL,
	`introduction` text COMMENT '简介',
	`language` VARCHAR ( 10 ) NOT NULL,
	`price` DECIMAL ( 10, 2 ) NOT NULL,
	`pub_date` date NOT NULL COMMENT '出版时间',
	`class_id` INT DEFAULT NULL,
	`number` INT DEFAULT NULL COMMENT '在馆剩余数量' 
) ENGINE = INNODB DEFAULT CHARSET = utf8;
ALTER TABLE `book_info` MODIFY `book_id` BIGINT NOT NULL AUTO_INCREMENT,
AUTO_INCREMENT = 1;
CREATE TABLE `class_info` ( 
`class_id` INT NOT NULL COMMENT '类别号（中图网的数字编号）', 
`class_name` VARCHAR ( 50 ) NOT NULL ) ENGINE = INNODB DEFAULT CHARSET = utf8;
CREATE TABLE `lend_list` (
	`ser_num` BIGINT NOT NULL PRIMARY KEY COMMENT '流水号',
	`book_id` BIGINT NOT NULL,
	`reader_id` BIGINT NOT NULL,
	`lend_date` date DEFAULT NULL,
	`back_date` date DEFAULT NULL 
) ENGINE = INNODB DEFAULT CHARSET = utf8;
ALTER TABLE `lend_list` MODIFY `ser_num` BIGINT NOT NULL AUTO_INCREMENT,
AUTO_INCREMENT = 1;
CREATE TABLE `reader_info` (
	`reader_id` BIGINT NOT NULL PRIMARY KEY,
	`name` VARCHAR ( 10 ) NOT NULL,
	`sex` VARCHAR ( 2 ) NOT NULL,
	`rdType` VARCHAR(10) NOT NULL,
	`birth` date NOT NULL,
	`subject` VARCHAR ( 20 ) NOT NULL COMMENT '专业',
	`address` VARCHAR ( 50 ) NOT NULL,
	`phone` VARCHAR ( 15 ) NOT NULL 
) ENGINE = INNODB DEFAULT CHARSET = utf8;
ALTER TABLE `reader_info` MODIFY `reader_id` BIGINT NOT NULL AUTO_INCREMENT,
AUTO_INCREMENT = 10000;
CREATE TABLE `reader_card` (
	`reader_id` BIGINT NOT NULL PRIMARY KEY,
	`username` VARCHAR ( 15 ) NOT NULL,
	`subject` VARCHAR ( 20 ) NOT NULL,
	`datevaild` BIGINT NOT NULL COMMENT'有效日期（0为永久有效）',
	`password` VARCHAR ( 15 ) NOT NULL 
) ENGINE = INNODB DEFAULT CHARSET = utf8;
COMMIT;