INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (1, '邓小平与中国特色社会主义', '田克勤, 李婧 ', '中国人民大学出版社', , '9787300221205', '本书以新时期马克思主义中国化的推进为主线，以中国特色社会主义为主题，以改革开放和社会主义现代化建设为实践背景，以邓小平同志在开创中国特色社会主义道路、形成中国特色社会主义理论体系、确立中国特色社会主义制度过程中所做出的杰出贡献为主要内容，力求深入阐述邓小平和邓小平理论的历史地位及其当代价值，充分体现党的十八大和习近平总书记系列重要讲话精神。', '中文', 78.00, '2016-09-09', 1, 2);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (2, '气质', '(美) 奥里森·斯威特·马登 ', ' 中国人民大学出版社', , '9787300219196', '在人身上，有一些东西超乎外表，是传记作者或照相机所无法捕捉到的东西，是只能够靠感觉传递的东西，是人由内而外散发出的生命力量，这种神奇的力量如同电流般让人难以捉摸。这也就是我们常说的“气质”。它微妙却又真实地存在着。有些人给人的感觉像是月亮，冷漠而毫无生气，另一些人则像太阳，向外散发着光和热、愉快和欢乐，让人感到灵魂深处的温暖。在本书中，著名的励志导师奥里森•斯威特•马登将通过生动的事例，告诉你如何成为一个拥有优秀气质的人，挖掘出你生命中最为独特和美好的一面。', '中文', 36.00, '2016-09-09', 2, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (3, '中国大学人文启思录', '本书编委会 ', '华中理工大学出版社', , '7560913695', '本书汇集受到学生欢迎的人文讲座讲演录。主要在华中理工大学、清华大学、北京大学、北京科技大学、中国人民大学、复旦大学、华东师范大学等50所参加国家教委文化素质教育试点工作的高校师生提供。第一卷收入50位国内外讲演者的讲演稿。主题涉及大学与人才，中国与世界，传统与现代，文化与思潮，文学与艺术，哲学自科学，经济与社会等方面。', '中文', 15.80, '2013-09-09', 3, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (4, '建设工程法规及相关知识精讲与题解', '马庆华 ', '西安电子科技大学出版社', , '9787560639321', '建设工程法规及相关知识精讲与题解', '中文', 39.00, '2016-09-09', 4, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (5, '火与剑的海洋 : 帝国的崛起与衰落', '宋宜昌', '人民邮电出版社', , '9787115365477', '《火与剑的海洋 : 帝国的崛起与衰落', '中文', 49.00, '2015-09-09', 5, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (6, '经济学原理（上下）', '[美] 曼昆 ', '机械工业出版社', , '9787111126768', '此《经济学原理》的第3版把较多篇幅用于应用与政策，较少篇幅用于正规的经济理论。书中主要从供给与需求、企业行为与消费者选择理论、长期经济增长与短期经济波动以及宏观经济政策等角度深入浅出地剖析了经济学家们的世界观。', '英文', 88.00, '2003-09-09', 6, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (7, '青年亚文化研究年度报告 ', '马中红', ' 清华大学出版社', , '9787302365846', '本书是2013年人文社会科学领域有关青年亚文化研究的全景展示，包括提纲挈领的年度报告、精选的年度文选、工作坊案例、境外传真、大事记、文化现象扫描以及重要著译介绍。', '中文', 45.00, '2013-09-09', 7, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (8, '现代汉语.上册', '黄伯荣, 廖序东', '高等教育出版社', , '9787040214031', '本书是编者黄伯荣和廖序东原“兰州本”《现代汉语》的增订四版。1991年1月出版的“增订版”对原“兰州本”作了大幅度修订，此后又经三次修订，主体框架不变，但都调整了部分内容，吸收了新的科研成果，以适应新形势下的教学。这一次的“增订四版”已于2006年被教育部列为“普通高等教育‘十一五’国家级规划教材”，按统一规定改为“国际流行开本”，仍分上下两册出版。为了便于教与学，特别是为了便于“自考”学生自学，本书编者另编有《(现代汉语(增订四版)》教学与自学参考》，读者可另行购买。本册为上册。', '中文', 17.00, '2007-09-09', 8, 2);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (9, '边城', '沈从文 ', '江苏人民出版社', , '9787214149879', '《边城》是沈从文最负盛名的代表作品，以20世纪30年代川湘交界的边城小镇茶峒为背景，以兼具抒情诗和小品文的优美笔触，描绘了湘西边城淳朴的世道民风和天然的生活状态。语言古朴清新，寄托着从文先生关于“美”与“爱”的美学理想，彰显了人性的至真、至善与至美。本书除收录《边城》外，还精选了其最具代表性的“人性美”小说9篇，内容详实，最新修订，引领读者重寻湘西世界的自由朴野之美。', '中文', 25.00, '2015-09-09', 9, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (10, '世界名画全知道', '乔会根', '北京联合出版公司', , '9787550266018', '本书为艺术类通俗读物。将一百多幅名气大、影响广、代表性强的世界名画辑录成册，为了帮助读者提高阅读效果，书中设置了“必知理由”、“名画档案”、“画家简介”、“名画欣赏”、“绘画知识”等栏目，从艺术、历史、文化等多个角度解读世界名画的精髓之所在，让读者深刻体会名画背后鲜为人知的故事，领略艺术大师们创作的艰辛，全方位把握西方艺术所蕴涵的人文精神。', '中文', 29.80, '2016-09-09', 10, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (11, '明朝那些事儿[7]:大结局', '当年明月', '中国海关出版社', , '9787801655998', '明朝最后一位皇帝，自来有许多传说。关于崇祯究竟是一个昏庸无能的皇帝，还是一个力图奋起的人，一直众说纷纭。不管怎么说，这是一个残酷的时代，也是一个精彩的时代。本书对这一段历史进行了分析梳理，引人思索。', '中文', 29.80, '2009-09-09', 11, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (12, '必然', '(美) 凯文·凯利', '电子工业出版社', , '9787121272394', '《必然》的作者凯文·凯利，被称为“硅谷精神之父”和“世界互联网教父”。前两部《失控》和《科技想要什么》在中国出版后，引起巨大反响。书中凯文·凯利对十二种必然的科技力量加以详细的阐述，并描绘出未来三十年这些趋势如何形成合力指引我们前行的方向。', '中文', 26.00, '2007-01-01', 12, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (13, '时与光 : 一场从古典力学到量子力学的思维盛宴 ', '棽棽', '清华大学出版社', , '9787302407454', '这是一部像推理小说一样“烧脑”的科学史话。跟随书中的一个个智者，你将从古典力学走向经典体系，最终跨入理论物理的前沿阵地。', '中文', 59.00, '2015-09-09', 13, 0);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (14, '地球100神秘地带', '《国家地理系列》编委会', '吉林出版集团', , '9787546314105', '行走在风雨变幻的梦里，那些碧树繁花绽放着不属于尘世的光华。远远地看，幻想般的山光水色，美丽得让人忘记了忧伤。走过的地方，开始的旅途，都是一个过程，没有终点。在不同的地方，发现新的自己，让心去远航，让梦走得更长。', '中文', 19.80, '2010-09-09', 14, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (15, '遗传学 : 基因和基因组分析 : analysis of genes and genomes', '(美) D.L. 哈特尔, M. 鲁沃洛', '科学出版社', , '9787030428219', '《遗传学：基因和基因组分析：第8版》为哈佛大学生命科学类本科生必修课程“生命科学综合介绍：遗传学、基因组学与进化”的教材，全面介绍了遗传学和基因组学的基本原理和实验方法，内容包括基因传递、突变、表达和调控的基本过程，遗传学和分子生物学研究的主要实验方法，以及遗传学和基因组学的一些社会历史背景。', '中文', 50.00, '2015-01-09', 15, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (16, '极简医学史 : a short history of medicine', '(英) 罗伊·波特', ' 清华大学出版社', , '9787302425267', '医学的历史就是人类的历史，人类一直在为生存与健康而战，这是最原始最普遍的斗争。', '中文', 39.00, '2016-01-01', 16, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (17, '看不见的森林 : 林中自然笔记', '(美) 戴维·乔治·哈斯凯尔', '商务印书馆', , '9787100104685', '这是一本森林观测笔记。在这本书里，一位生物学家以一年的时间为主线，在每次的观测中，为我们揭开藏森林一平方米地域里的秘密。在这本完全原创的书里，生物学家戴维以一小片森林作为整个自然界的缩影，向我们生动地展示了这片森林和居住其中的栖息者的生活状况。书的每一章都以一次简单的观察结果作为开头，比如藏在落叶层里的火蜥蜴，春天里野花的初次绽放。', '中文', 46.00, '2014-04-18', 17, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (18, '纳米改性沥青及其路用性能', '孙璐', '科学出版社', , '9787030343468', '《纳米改性沥青及其路用性能》以零维纳米粒子和二维层状纳米材料为复合改性剂，详细介绍了其对沥青路面常用基质沥青进行改性研究的理论方法和实验过程。', '中文', 30.00, '2012-09-09', 18, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (19, 'Python数据分析', '(印尼) Ivan Idris', '人民邮电出版社', , '9787115411228', '作为一种高级程序设计语言，Python凭借其简洁、易读及可扩展性日渐成为程序设计领域备受推崇的语言。同时，Python语言的数据分析功能也逐渐为大众所认可。', '中文', 59.00, '2016-09-09', -6, 1);
INSERT INTO `book_info` (`book_id`, `name`, `author`, `publish`, `cover`, `ISBN`, `introduction`, `language`, `price`, `pub_date`, `class_id`, `number`) VALUES (20, 'Python密码学编程', '(美)Al·Sweigart', '人民邮电出版社', , '9787115424297', '本书主要介绍了加密算法，同时从Python编程的角度来引导读者将加密算法更好地实现。书中不仅讲述了详细的算法理论，还附以详细的代码示例帮助读者更好地学习算法，并最终实现加密算法。除此之外，书中还提供了相应的源码下载资源，能够让读者获取到最完整真实的代码示例，帮助读者更好地进行后续的开发和学习。', '中文', 56.00, '2016-09-09', -9, 1);
